import React from 'react'
import './style/Header.css'

class Header extends React.Component{
    render(){
        return(
            <React.Fragment>
            <div className="Header">
                <img src="" alt="Kimetsu no Yaiba"/>
            </div>  
            </React.Fragment>
        );
    }
}

export default Header;
